INSERT INTO TBL_822C86E50BE84592A79545CD6DBAB5C4 VALUES('ATmega328 AArduino Uno R3 Rev3 SMD ATMEGA328P Compatible Board.\u000a\u000a','26b6a020-5aeb-460a-884c-b9149550dfc5','2022-09-14','a975b9f7-c4e2-44c6-ae94-2f2fe9680aa9','1793c599-2365-48e5-9032-e00e0b4774d1',NULL,'2022-09-14','ATmega328 AArduino Uno R3 Rev3 SMD ATMEGA328P Compatible Board',NULL,'\u000aThe DCcduino Uno is a microcontroller board based on the ATmega328 and compatible with the Arduino Uno R3. It has 14 digital I/O pins, 6 analog inputs, a 12MHz crystal oscillator, a USB connection, a power jack, an ICSP header, and a reset button. It contains everything needed to support the microcontroller; simply connect it to a computer with a USB cable or power it with an AC-to-DC adapter or battery to get started. These are brand new and stocked in the UK for Fast Delivery!\u000a\u000aThe DCcduino Uno has all the same major connectors as the Arduino Uno R3 and should be compatible with the same Arduino shields. Additionally, there are several extra sets of header connectors \u2013 some of which provide extra signals that are not easily accessible on the original board. We can optionally provide header pins for these connectors \u2013 please note that these pins are provided loose and you will need to solder them on before they can be used. The optional header pins will be provided as 1 long row of header pin, simply break of at the desired length.\u000a\u000a14 digital input/output pins \u2013 6 pins can be used as PWM outputs\u000a6 analog inputs\u000a12 MHz crystal oscillator\u000aOperates at 5V\u000aRecommended input voltage range: 7V to 12V\u000aFlash Memory: 32 KB (0.5KB used by bootloader)\u000aSRAM: 2KB\u000aEEPROM: 1KB\u000aUSB to Serial CH340G',NULL,NULL,NULL,NULL)
