INSERT INTO TBL_822C86E50BE84592A79545CD6DBAB5C4 VALUES('Ublox NEO-6/7M GPS Module','26b6a020-5aeb-460a-884c-b9149550dfc5','2022-09-14','f75822f1-52c5-4486-8e9d-92ee2a3b79d5','1a4a76ce-1fe7-4e3f-9655-f7e8effbcadf',NULL,'2022-09-14','Ublox NEO-6/7M GPS Module',NULL,'Beskrivelse\u000aUblox NEO-7M GPS Module. F\u00e5 information om hvor modulet befinder sig.\u000a\u000aTekniske detaljer:\u000aInterface features : TTL level compatible with 3.3V/ 5V systems\u000aReception characteristics : 56 channels , GPS L1 (1575.42Mhz) C/A code , SBAS:WAAS / EGNOS / MSAS;\u000aPositioning accuracy : 2.5mCEP (SBAS: 2.0mCEP)\u000aUpdate rate :Maximum 10Hz ( default 1HZ)\u000aAcquisition Time : Cold start : 27S ( fastest )\u000aTracking Sensitivity : -162dBm\u000aAcquisition sensitivity ( cold start ): -148dBm\u000aOscillator : TCXO (+/- 0.5PPM)\u000aCommunication Protocol : NMEA ( default ) / UBX Binary\u000aSerial communication baud rate : 9600\u000aSpeed limit : 500m / s\u000aHeight restriction : 50000m\u000aWorking temperature : -40 C to 85 C\u000aOperating voltage : 2.7V-5.0V (VCC pin input )\u000aWorking Current : 35mA\u000aTXD / RXD Impedance: 510 ohm',NULL,NULL,NULL,NULL)
