INSERT INTO TBL_822C86E50BE84592A79545CD6DBAB5C4 VALUES('Arduino Uno m. USB kabel','26b6a020-5aeb-460a-884c-b9149550dfc5','2022-09-14','66ffd9f9-3205-41b8-84d8-2ccdc8ed74c9','27551b9d-26a5-4218-b121-61aadd13f43c',NULL,'2022-09-14','Arduino Uno m. USB kabel',NULL,'Arduino Uno is a microcontroller board based on the ATmega328P (datasheet). It has 14 digital input/output pins (of which 6 can be used as PWM outputs), 6 analog inputs, a 16 MHz ceramic resonator (CSTCE16M0V53-R0), a USB connection, a power jack, an ICSP header and a reset button. It contains everything needed to support the microcontroller; simply connect it to a computer with a USB cable or power it with a AC-to-DC adapter or battery to get started.. You can tinker with your Uno without worrying too much about doing something wrong, worst case scenario you can replace the chip for a few dollars and start over again.\u000a\u000a',NULL,NULL,NULL,NULL)
